export type MarkdownReaderPage = {
  /**
   * path to be used as the url. no preceding slash
   */
  queryPath: string;
  /**
   * if given, the md-file will be provided to the frontend
   *
   * project relative path
   */
  filePath?: string;
  /**
   * if true, this item will be shown in the menu
   */
  isMenuItem?: boolean;
};
